import Block from './Block'

const BlockSet =() => {
    return(
        <div className="absolute top-[20%] w-[200%] h-[75%] bg-sharkGray">
            <Block top={"10%"} left={"5%"} text={"ㄱ"}/>
            <Block top={"20%"} left={"14%"} z={10}/>
            <Block top={"30%"} left={"16%"} z={10}/>
        </div>
    )
}

export default BlockSet;
